import { Switch } from "@mui/material";

const ByeSell = () => {
  return (
    <div
      style={{
        height: "100vh",
        width: "100%",
        background: "gray",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      <div
        style={{
          height: "50%",
          width: "90%",
          background: "white",
          display: "flex",
        }}
      >
        <div
          style={{
            flex: 5,
            display: "flex",
            padding: 10,
          }}
        >
          <div
            style={{
              flex: 5,
              display: "flex",
              alignItems: "center",
              justifyContent: "space-around",
              flexDirection: "column",
            }}
          >
            <p style={{ fontSize: 22, alignItems: "left" }}>COIN NAME</p>
            <p style={{ fontSize: 22, alignItems: "left" }}>BUYING AMOUNT</p>
            <p style={{ fontSize: 22, alignItems: "left" }}>SELLING AMOUNT</p>
            <p style={{ fontSize: 22, alignItems: "left" }}>GRID AMOUNT</p>
          </div>
          <div
            style={{
              flex: 5,
              display: "flex",
              alignItems: "center",
              justifyContent: "space-around",
              flexDirection: "column",
            }}
          >
            <div
              style={{ height: "15%", width: "60%", border: "1px solid black" }}
            >
              div_1
            </div>
            <div
              style={{ height: "15%", width: "60%", border: "1px solid black" }}
            >
              div_2
            </div>
            <div
              style={{ height: "15%", width: "60%", border: "1px solid black" }}
            >
              div_3
            </div>
            <div
              style={{ height: "15%", width: "60%", border: "1px solid black" }}
            >
              div_4
            </div>
          </div>
        </div>
        <div style={{ flex: 5, display: "flex", padding: 10 }}>
          {" "}
          <div
            style={{
              flex: 5,
              display: "flex",
              alignItems: "center",
              justifyContent: "space-around",
              flexDirection: "column",
            }}
          >
            <p style={{ fontSize: 22, alignItems: "left" }}>AUTO SELLING</p>
            <p style={{ fontSize: 22, alignItems: "left" }}>AUTO BUYING</p>
            <p style={{ fontSize: 22, alignItems: "left" }}>SELLING AMOUNT</p>
            <p style={{ fontSize: 22, alignItems: "left" }}>GRID AMOUNT</p>
          </div>
          <div
            style={{
              flex: 5,
              display: "flex",
              alignItems: "center",
              justifyContent: "space-around",
              flexDirection: "column",
            }}
          >
            <div
              style={{ height: "15%", width: "60%", border: "1px solid black" }}
            >
              <Switch defaultChecked />
            </div>
            <div
              style={{ height: "15%", width: "60%", border: "1px solid black" }}
            >
              div_2
            </div>
            <div
              style={{ height: "15%", width: "60%", border: "1px solid black" }}
            >
              div_3
            </div>
            <div
              style={{ height: "15%", width: "60%", border: "1px solid black" }}
            >
              div_4
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ByeSell;
